    def test_get_balance(self):
        balance_mock_response = [
            {'balances': [{'account': '0.0.38674', 'balance': 198579805702, 'tokens': []}], 'links': {'next': None},
             'timestamp': '1693641429.988415003'},
            {'balances': [{'account': '0.0.41106', 'balance': 131246683714, 'tokens': []}], 'links': {'next': None},
             'timestamp': '1693641467.985970003'}]
        self.api.request = Mock(side_effect=balance_mock_response)
        HederaExplorerInterface.balance_apis[0] = self.api
        balances = BlockchainExplorer.get_wallets_balance({'HBAR': self.addresses_of_account}, Currencies.hbar)
        expected_balances = [
            {'address': '0.0.38674', 'balance': Decimal('1985.79805702'), 'received': Decimal('1985.79805702'),
             'rewarded': Decimal('0'), 'sent': Decimal('0')},
            {'address': '0.0.41106', 'balance': Decimal('1312.46683714'), 'received': Decimal('1312.46683714'),
             'rewarded': Decimal('0'), 'sent': Decimal('0')}
        ]
        for balance, expected_balance in zip(balances.get(Currencies.hbar), expected_balances):
            assert balance == expected_balance

